import React, { Component } from "react";
import "../styles/stylesheet.css";
import "../styles/Article.css";
import Navbar from "./Navbar.js";
import Footer from "./Footer.js";
import axios from "axios";

export default class Article extends Component<> {
  constructor(props) {
    super(props);

    this.state = {
      news: null,
      isLoaded: false,
      errorMsg: null,
      id: 1
    };
  }

  async componentDidMount() {
    const test = this.props.match.params.id;

  }
  render() {
    const { news, isLoaded, errorMsg } = this.state;
    if (errorMsg) {
      return <div>{errorMsg.message}</div>;
    } else if (!isLoaded) {
      return <div>Loading...</div>;
    } else {
      return (
        <div className="home-container bg-light">
          <Navbar />
          <img id="image" src="../resources/trump1920x1080.jpg" />
          <div className="text-box">
            <h1>{news[0].overskrift}</h1>
            <br />
            <p id="info-text">Av KASPER VEDAL GUNDERSEN | 22.10.2019 | 15:53</p>
            <br />
            <p className="mx-auto">
              NEW YORK (IrishMedia): Det kontroversielle bildet ble delt på
              Twitter i helgen, og viser Donald Trump som blir drept av hælen
              til Nancy Pelosi,
            </p>
          </div>

          <Footer />
        </div>
      );
    }
  }
}
